16.body:
Items in sequences are captured during execution. They are temporarily pushed and hold onto a stack, for later access. It is possible to access previously captured items using capture variables . Capture variables start with a dollar-sign ($) followed either by an index, an aliased name or any Tokay expression which evalutes to an index or an aliased named dynamically. Given the expression first => Word _ second => Word _ third => Word executed on the input Save the planet the sequence and input can be broken down into the following components. Capture $1 $2 $3 $4 $5 Alias $first $second $third Sequence first =&gt; Word _ second =&gt; Word _ third =&gt; Word Input "Save" " " "the" " " "Planet" $0 contains "Save" "Save " "Save the" "Save the " "Save the planet" As you can see, $0 always contains the input matched so far from the start of the capture. Tokay also allows to assign values to captures. This makes it possible to directly use captures like any other variable inside of the sequence and any subsequent blocks that belong to the sequence. # planets2.tok
Name { if $1 == "Earth" { $1 = "Home" } else if $1 == "Mars" || $1 == "Venus" { $1 += " (neighbour)" }
} $ tokay planets2.tok -- "Mercury Venus Earth Mars Jupiter"
("Mercury", "Venus (neighbour)", "Home", "Mars (neighbour)", "Jupiter")

