The if...else-construct implements conditional branching depending on the result of an expression. The else part is optional, and can be omitted. if sense == 42 && axis == 23.5 { print("Well, this is fine!")
}
else { print("That's quite bad.")
} As stated before, all control structures are part of Tokays expression syntax. Above example can easily by turned into print( if sense == 42 && axis == 23.5 "Well, this is fine!" else "That's quite bad."
) or directly used inside of an expression. # if can be part of an expression
Word "Hello " + if $1 == "World" "Earth" else $1 if...else constructs working on static expressions are optimized away during compile-time.

34.body:
The loop-keyword is used to create loops, either with an aborting conditions on top or without any condition. # Countdown
count = 10
loop count >= 0 print( if --count == 3 "Ignition" else if count < 0 "Liftoff" else count
) A loop can be aborted everytime using the break-statement. The continue-statement restarts the loop at the beginning, but a present abort-condition will be re-checked again. count = 10
loop { count = count - 1 if count == 3 { print("Ignition") continue } print(count) if count == 0 { print("Liftoff") break }
} A loop without any aborting condition loops forever. loop print("Forever!")

7.body:
Sequences are organized in blocks. Blocks may contain several sequences, which are executed in order of their definition. Every sequence inside of a block is separated by a newline. Blocks are defined by curly braces {...} and introduce a new alternation of sequences. Sequences in a block are executed in order until an item of a sequence or the sequence itself accepts or rejects the block. Sequences are lines in a block, delimited by either the end of the line, a semicolon ; or the blocks closing brace }. They are made of items. Items are expressions like 1 + 2 or ++i * 3 assignments like x = 42 or s += "duh" calls to 'tokens', functions() or Parselets control flow instructions like if x == 42 "yes" else "no" and even further { blocks } { # a block... # ... has sequences itemÂ¹ itemÂ² itemÂ³ ... # made of items. itemÂ¹ { # an item of a sequence can be a block again itemÂ¹ itemÂ² ... # which contains further sequences with items } {} # this empty block is the only item of the third sequence of the outer block
} Blocks implicitly return the value of the last sequence being executed. Thus, a = { 1 + 2 4
} assigns 4 to a, but calculates 3 in between.
